import {Component, OnInit} from '@angular/core';
import {AppService} from "../../../services/app.service";

@Component({
  selector: 'app-header',
  templateUrl: './header.component.html',
  styleUrls: ['./header.component.css']
})
export class HeaderComponent implements OnInit {
  headerColor!: string;
  zone!: string;
  file = ''

  constructor(private appService: AppService) { }

  ngOnInit(): void {
    this.appService.polygon.subscribe(polygon => {
      this.headerColor = polygon.color;
      this.zone = polygon.name;
    })
    this.updateManifest();
  }

  updateManifest(): void {
    const currentLocation = window.location.origin;
    var myDynamicManifest = {
      "name": "Your Great Site",
      "short_name": "Your Great Site short name",
      "description": "Something dynamic",
      "start_url": `${currentLocation}/`,
      "background_color": "#000000",
      "theme_color": "#0f4a73",
      "display": "standalone",
      "icons": [
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "72x72",
          "type": "image/png",
          "purpose": "maskable any"
        },
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "96x96",
          "type": "image/png",
          "purpose": "maskable any"
        },
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "128x128",
          "type": "image/png",
          "purpose": "maskable any"
        },
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "144x144",
          "type": "image/png",
          "purpose": "maskable any"
        },
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "152x152",
          "type": "image/png",
          "purpose": "maskable any"
        },
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "192x192",
          "type": "image/png",
          "purpose": "maskable any"
        },
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "384x384",
          "type": "image/png",
          "purpose": "maskable any"
        },
        {
          "src": this.getDataUrlForBase64(this.file, "image/png"),
          "sizes": "512x512",
          "type": "image/png",
          "purpose": "maskable any"
        }
        ]
      }
      const link = document.createElement("link");
      link.rel = "manifest";
      const stringManifest = JSON.stringify(myDynamicManifest);
      link.setAttribute('href', 'data:application/json;charset=utf-8,' + encodeURIComponent(stringManifest))
      document.head.appendChild(link);
    }

    getDataUrlForBase64(base64String: string, mimetype: string) {
      return `data:${mimetype};base64,${base64String}`;
    }
}
